  `nameLast` varchar(15) NOT NULL,
  `nameFull` varchar(30) NOT NULL,
  `yearID` int(11) NOT NULL,
  `setID` varchar(3) NOT NULL,
  `cardNo` int(11) NOT NULL,
  `team` varchar(20) NOT NULL,

  `control` int(11) NOT NULL,
  `PU` int(11) NOT NULL,
  `SO` int(11) NOT NULL,
  `GB` int(11) NOT NULL,
  `FB` int(11) NOT NULL,
  `BB` int(11) NOT NULL,
  `1B` int(11) NOT NULL,
  `2B` int(11) NOT NULL,
  `HR` int(11) NOT NULL,

  `points` int(11) NOT NULL,
  `IP` int(11) NOT NULL,

  `hand` varchar(3),
  `Pos` varchar(10) NOT NULL,
  PRIMARY KEY (`yearID`,`setID`,`cardNo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

